import React from 'react';
import { useSelector } from 'react-redux';

import './App.css';
import Login from './component/auth/Login';
import QnA from "./component/QnA";
import { selectUser } from './features/userSlice';

function App() {
  const user = useSelector(selectUser)
  return (
    <div className="App">
      {
        user?(<QnA/>):(<Login/>)
      }
    </div>
  );
}

export default App;
